import './App.css';
import Navbar from './Components/Navbar';
import {Router,Swtich,Route} from 'react-router-dom';
function App() {
  return (
  <main>
    <Router>
      <Swtich>
        <Route path="/" component="Home"></Route>
      </Swtich>
    </Router>
    <Navbar/>
  </main>
  );
}

export default App;
